mutation funnelCompute ($input: FunnelComputeInput) {
    funnelCompute (input: $input) {
        cached_response {
            ttl
            id
            computed_at
            fresh
        }
        total_sessions
        total_visitors
        total_events
        conversion_value {
            value
            label
        }
        steps {
            sessions
            visitors
            events
        }
    }
}
